a("accueil.kiosques.mrFiche", '{"titre":"Que sont les Manuels numériques ?","html":{"_T":23,"V":"<p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">Les&nbsp;Manuels num&eacute;riques&nbsp;sont des ressources disponibles pour l\'ensemble de votre &eacute;tablissement depuis le site web&nbsp;d\'un partenaire :&nbsp;kiosques num&eacute;riques ou &eacute;diteurs. </span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><br />PRONOTE vous permet d\'acc&eacute;der directement au contenu en ligne des manuels sans que vous ayez besoin de vous r&eacute;-authentifier aupr&egrave;s du partenaire. </span></p><p><br /><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">En cliquant sur le lien d\'un des manuels&nbsp;depuis votre page d\'accueil, votre cahier de textes ou vos ressources p&eacute;dagogiques, vous serez redirig&eacute;s vers&nbsp;le site du partenaire concern&eacute;, plateforme ind&eacute;pendante de PRONOTE.&nbsp;Lorsqu\'une fl&egrave;che verte <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />&nbsp;est accol&eacute;e au logo de l\'&eacute;diteur,&nbsp;cela signifie que le manuel permet de partager un lien vers un &eacute;nonc&eacute;, un corrig&eacute;, une vid&eacute;o ou un article (etc.) directement dans PRONOTE.</span></p><p>&nbsp;</p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">Pour ajouter un lien :</span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">1. <strong>Depuis le contenu du manuel num&eacute;rique</strong>, s&eacute;lectionnez la ressource &agrave; l\'aide des ic&ocirc;nes correspondantes : <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />, <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />, <img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAIAAACQkWg2AAAAZUlEQVQokWP4evUySYgBztoqJw5BaGycGuDa0EhibSBKA1Z7yPTDp7OnsfsBK4Lr/3j6FD4NWMMKiwY8YYrQ8O7IYYJKoRo+njmNqQ5PABDwA2YQY9eAJxJxasAViUTZQKwfsCIAfzw1EfSaHBoAAAAASUVORK5CYIIA\\\" alt=\\\"\\\" /><br /></span></span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">2. Envoyez le lien de la ressource vers PRONOTE</span></span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">3. <strong>Depuis PRONOTE</strong>, en fonction de l\'ic&ocirc;ne choisie, s&eacute;lectionnez et ajoutez le lien depuis les affichages correspondants :</span></span></p><ul><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><strong>Saisie du cahier de textes</strong> : ajouter le lien &agrave; un contenu ou en documents joints dans un travail &agrave; faire</span></span></li><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><strong>Saisie d\'un travail &agrave; faire *</strong> : ajouter un exercice num&eacute;rique en associant un lien &agrave; un travail &agrave; faire, l\'&eacute;l&egrave;ve y r&eacute;pondra directement sur le site de l\'&eacute;diteur et vous r&eacute;cup&eacute;rerez automatiquement ses r&eacute;ponses dans PRONOTE.</span></span></li><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><strong>Saisie des notes *</strong> : ajouter un idevoir en associant un lien &agrave; un devoir, l\'&eacute;l&egrave;ve y r&eacute;pondra directement sur le site de l\'&eacute;diteur et vous r&eacute;cup&eacute;rerez automatiquement ses r&eacute;ponses et sa note dans PRONOTE.</span></span></span></span></li></ul><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">* Disponible uniquement avec G&eacute;n&eacute;ration 5, la fonctionnalit&eacute; a &eacute;t&eacute; propos&eacute;e &agrave; l\'ensemble des &eacute;diteurs partenaires.</span></span></span></span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 11px;\\\">&nbsp;</span></span></p>"},"width":425,"height":185,"type":4,"boutons":{"_T":18,"V":1024}}');
