a("BulletinEtReleve.MFichePostionnement", '{"titre":"Comment fonctionne l\'attribution automatique d\'un positionnement ?","html":{"_T":23,"V":"<p><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\\">Il existe 4 modes de calcul qui permettent de d&eacute;finir les &eacute;valuations &agrave; prendre en compte (dans tous les cas les &eacute;valuations de coefficient nul sont ignor&eacute;es) :</span></p><ul><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\\">Mode 1 : toutes les &eacute;valuations affich&eacute;es&nbsp;</span></li><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\\">Mode 2 : les 5 derni&egrave;res &eacute;valuations, lorsque des &eacute;valuations ont lieu &agrave; la m&ecirc;me date, on retient celles auxquelles l\'&eacute;l&egrave;ve a eu les meilleurs r&eacute;sultats</span></li><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\\">Mode 3 : les 5 &eacute;valuations offrant le meilleur r&eacute;sultat</span></li><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\\">Mode 4 : toutes les &eacute;valuations coefficient&eacute;es progressivement (coeff 1 &agrave; la plus ancienne, puis 2, puis 3 ...)</span></li></ul><p><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\\">L\'&eacute;chelle de valeurs utilis&eacute;e pour le calcul est d&eacute;finie dans <span style=\\\"color: #888888;\\\"><strong><em>Param&egrave;tres &gt; &Eacute;valuation &gt; Niveaux de ma&icirc;trise</em></strong></span>.</span>&nbsp;<em><span>(Illustration avec les couleurs par d&eacute;faut)&nbsp;</span></em></p><ol><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">Le r&eacute;sultat obtenu &agrave; chaque &eacute;valuation prise en compte est transform&eacute; en points&nbsp;</span><br /><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">avec les valeurs par d&eacute;faut&nbsp;&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />&nbsp;= 50 points |&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" /> = 40 points |&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAZUlEQVQYlZXQMQ7AIAgFULuLh+JcXqp6m4aN1ZH9d7CmTa0JJQwML0B+gKPCPVqBMoQgBGVYnVDLOLZ3t/xAVj9EbysDKS+R8kCSlkiSB9Gvc1Ycj7siuMLcoQyJkAjlvmNC6zoBm69Vps8BQyUAAAAASUVORK5CYII=\\\" alt=\\\"\\\" /> = 25 points |&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\\" alt=\\\"\\\" /> = 10 points<br />Quand les niveaux interm&eacute;diaires <span>sont utilis&eacute;s&nbsp;</span><img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAcklEQVQYlZXQLQ6AMAwF4N0EzU7UO3EWRC2b6h1mYerNzVWDGD/JCDCaioovbfPM2lDmnKBOQBwtRyugpL5GIQ/j3FUd8nChpP4uSkPdjgT0hAS0I472CXG0f1DTOaj7frwpgiPMSUC89Lz0Aio7avRSG8YxRv/F+sIoAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" />&nbsp;= 33 points et&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAaElEQVQYlZXQwQ3AIAgFUDfoWV2Jrbz0ImMwQjk7h+7ye7CmTa0JJRw4vAD5DoZy91gVQuAADhBC0wmVhH17d0kP1PRD9K46kNASCQ3EcYk4WlD4da5aHjdFcIV5QAjZI3sI9R0TWtcJl3BA5JUq0ykAAAAASUVORK5CYII=\\\" alt=\\\"\\\" />&nbsp;= 18 points.<br />Dans le cas du mode 4, le nombre de points de chaque &eacute;valuation est multipli&eacute; par son coefficient.<br /><br /></span></li><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">On obtient ainsi un nombre de points par mati&egrave;re&nbsp;pour chaque &eacute;l&egrave;ve.<br /><br /></span></li><li><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">On divise ce nombre de points par le nombre d\'&eacute;valuations pour obtenir une valeur&nbsp;sur l\'&eacute;chelle de 1 &agrave; 4 :<br />- plus de 45 points : <img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></span><br /><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">- entre&nbsp;33 et 45 &nbsp;points :&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></span><br /><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">- entre 18 et&nbsp; 33 points :&nbsp;<img style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\" src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></span><br /><span style=\\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\\">- moins de 18&nbsp;points : <img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA8AAAAPCAIAAAC0tAIdAAAAl0lEQVQokZWSSw7FIAhFO+6IJTTBfdGxI10krkkhxk5MrJ++vhIn4OGGXNjKl9juSWYWomRMBEjGCFFmXtGq6lzc9/mpc0Wko9XaJVobrG10DmH4LqUMlRxCpeU8B3SmhajS6TgG1ZlOiJWeB10UARbaT3TTFqJXus2dmd89Yb757f0vv73vdynyYZfdnSBGgIT4fCf/xQXkY7GV9RlSKQAAAABJRU5ErkJgggA=\\\" alt=\\\"\\\" /></span></li></ol>"},"width":630,"height":385,"type":4,"boutons":{"_T":18,"V":1024}}');
a("BulletinEtReleve.MFicheCalculNoteAutomatique", '{"titre":"Comment fonctionne l\'attribution automatique d\'une note","html":{"_T":23,"V":"<p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\">L\'attribution automatique d\'une note &agrave; chacun des &eacute;l&egrave;ves se base sur l\'&eacute;chelle de valeurs d&eacute;finie dans Param&egrave;tres &gt; &Eacute;valuations &gt; Niveaux de ma&icirc;trise.</span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\">1. Le r&eacute;sultat obtenu &agrave; chaque &eacute;valuation est transform&eacute; en points <em>(exemple avec les couleurs et valeurs par d&eacute;faut) :</em></span></p><ul><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\"><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /> : 50 points</span></li><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\"><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" /> : 40 points</span></li><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\"><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAZUlEQVQYlZXQMQ7AIAgFULuLh+JcXqp6m4aN1ZH9d7CmTa0JJQwML0B+gKPCPVqBMoQgBGVYnVDLOLZ3t/xAVj9EbysDKS+R8kCSlkiSB9Gvc1Ycj7siuMLcoQyJkAjlvmNC6zoBm69Vps8BQyUAAAAASUVORK5CYII=\\\" alt=\\\"\\\" /> : 25 points</span></li><li><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\"><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\\" alt=\\\"\\\" /> : 10 points</span></li></ul><p style=\\\"padding-left: 30px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\">Quand ils sont utilis&eacute;s les niveaux interm&eacute;diaires comptent pour&nbsp;33 (<img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAcklEQVQYlZXQLQ6AMAwF4N0EzU7UO3EWRC2b6h1mYerNzVWDGD/JCDCaioovbfPM2lDmnKBOQBwtRyugpL5GIQ/j3FUd8nChpP4uSkPdjgT0hAS0I472CXG0f1DTOaj7frwpgiPMSUC89Lz0Aio7avRSG8YxRv/F+sIoAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" />) et&nbsp;18 (<img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAaElEQVQYlZXQwQ3AIAgFUDfoWV2Jrbz0ImMwQjk7h+7ye7CmTa0JJRw4vAD5DoZy91gVQuAADhBC0wmVhH17d0kP1PRD9K46kNASCQ3EcYk4WlD4da5aHjdFcIV5QAjZI3sI9R0TWtcJl3BA5JUq0ykAAAAASUVORK5CYII=\\\" alt=\\\"\\\" />) points.</span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\">2. On obtient ainsi un nombre de points par mati&egrave;re&nbsp;pour chaque &eacute;l&egrave;ve.</span></p><p><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\">3.&nbsp;Ce nombre de points est ramen&eacute; sur le bar&egrave;me de notation de la classe et arrondi au point le plus proche.</span></p><p><em><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 12px;\\\">Exemple :<br />Pour un total de 135/250 points (5 &eacute;valuations) et un bar&egrave;me de notation sur 20, l\'&eacute;l&egrave;ve obtiendra la note de 11/20&nbsp;<br />(135*20)/250 = 10,8 arrondi au point pr&egrave;s, soit 11</span></em></p>"},"width":565,"height":315,"type":4,"boutons":{"_T":18,"V":1024}}');
a("BulletinEtReleve.MFichePostionnementCalculeNoteLSU", '{"titre":"Comment est calculée la note pour LSU ?","html":{"_T":23,"V":"<p><span style=\\\"font-size: 11px;\\\">La note pour LSU est calcul&eacute;e &agrave; partir des points attribu&eacute;s &agrave; chaque&nbsp;niveaux de ma&icirc;trise&nbsp;(d&eacute;finis dans&nbsp;\\\"Param&egrave;tres &gt; &Eacute;valuations &gt; Niveaux de ma&icirc;trise\\\").</span></p><p><span style=\\\"font-size: 11px;\\\">1. On fait la somme des points&nbsp;de tous&nbsp;les niveaux de maitrise obtenus aux &eacute;valuations</span></p><p><span style=\\\"font-size: 11px;\\\">2. On calcule la note LSU en&nbsp;ramenant ce total de points au&nbsp;bar&egrave;me de notation de la classe. <br /></span></p><p><span style=\\\"font-size: 11px;\\\"><em>Exemple avec les couleurs et valeurs par d&eacute;faut :</em></span></p><ul><li><span style=\\\"font-size: 11px;\\\"><em><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAeUlEQVQYlZWQuw2AMAxE3ccZ6vaKUJp4Ds+QUMMcYZlQgPhYfE8uLOvpzjpqH0TbVmqBgoVZGIpSi4W6saNIZsIQdqif+uV6iohEkXLNKwTFBhkzKFbIi79z8uIvIOPEwn/ics3vj7fWwhBeKjiW6ZJzyUGxeFjoQTPuSxGLzc5ImAAAAABJRU5ErkJggg==\\\" alt=\\\"\\\" />&nbsp;+ : 50 points</em></span></li><li><span style=\\\"font-size: 11px;\\\"><em><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" />&nbsp;: 40 points</em></span></li><li><span style=\\\"font-size: 11px;\\\"><em><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAZUlEQVQYlZXQMQ7AIAgFULuLh+JcXqp6m4aN1ZH9d7CmTa0JJQwML0B+gKPCPVqBMoQgBGVYnVDLOLZ3t/xAVj9EbysDKS+R8kCSlkiSB9Gvc1Ycj7siuMLcoQyJkAjlvmNC6zoBm69Vps8BQyUAAAAASUVORK5CYII=\\\" alt=\\\"\\\" />&nbsp;: 25 points</em></span></li><li><span style=\\\"font-size: 11px;\\\"><em><img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\\" alt=\\\"\\\" />&nbsp;: 10 points</em></span></li></ul><p><span style=\\\"font-size: 11px;\\\"><em>Avec les niveaux de maitrise suivants&nbsp;:&nbsp;<img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" />&nbsp;<img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\\" alt=\\\"\\\" />&nbsp;<img src=\\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\\" alt=\\\"\\\" />&nbsp;un &eacute;l&egrave;ve obtiendra la note de 12/20&nbsp;</em></span><em><span style=\\\"font-size: 11px;\\\">&nbsp;car il a obtenu&nbsp;90 points sur les 150 possibles.</span><br /></em></p>"},"width":545,"height":220,"type":4,"boutons":{"_T":18,"V":1024}}');
