a("AbsenceVS.MFicheFeuilleAppelVS", '{"titre":"Fonctionnement de la feuille \\\"Appel et suivi\\\" ?","html":{"_T":23,"V":"<div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">Personnalisation des rubriques</span></strong></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Vous pouvez choisir d\'ajouter des rubriques facultatives &agrave; votre feuille d\'appel :</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">- Dans votre espace enseignant (version Web), depuis la fen&ecirc;tre de param&egrave;tres de choix de rubriques facultatives <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" width=\\\"17\\\" height=\\\"17\\\" /><br /></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">- En mode enseignant, depuis la fen&ecirc;tre de personnalisation des colonnes de la liste <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" width=\\\"17\\\" height=\\\"17\\\" />.</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><strong>Lien avec la vie scolaire<br /></strong>&agrave; droite du nom de l\'&eacute;l&egrave;ve, diff&eacute;rentes ic&ocirc;nes vous renseignent :<strong><br /></strong></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><table style=\\\"width: 577px; height: 173px;\\\" border=\\\"0\\\"><tbody><tr style=\\\"height: 20px;\\\"><td style=\\\"height: 20px; width: 25px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;<img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></span></span></td><td style=\\\"height: 20px; width: 545px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: l\'&eacute;l&egrave;ve a une convocation</span></span></span></td></tr><tr style=\\\"height: 19px;\\\"><td style=\\\"height: 19px; width: 25px;\\\"><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 19px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: l\'absence a &eacute;t&eacute; saisie par la vie scolaire</span></span></td></tr><tr style=\\\"height: 19px;\\\"><td style=\\\"height: 19px; width: 25px;\\\">&nbsp;<img style=\\\"width: 18px; height: 16px;\\\" src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" width=\\\"26\\\" height=\\\"21\\\" /></td><td style=\\\"height: 19px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: l\'&eacute;l&egrave;ve n\'est absent que sur une partie du cours&nbsp;</span></span></td></tr><tr style=\\\"height: 19px;\\\"><td style=\\\"height: 19px; width: 25px;\\\">&nbsp;<img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 19px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: l\'&eacute;l&egrave;ve &eacute;tait absent &agrave; l\'heure pr&eacute;c&eacute;dente (en rouge si l\'absence est non r&eacute;gl&eacute;e administrativement)</span></span></td></tr><tr style=\\\"height: 19px;\\\"><td style=\\\"height: 19px; width: 25px;\\\">&nbsp;<img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 19px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: projet d\'accompagnement mis en place pour l\'&eacute;l&egrave;ve</span></span></td></tr><tr style=\\\"height: 16px;\\\"><td style=\\\"height: 16px; width: 25px;\\\">&nbsp;<img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 16px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: m&eacute;mos de la vie scolaire</span></span></td></tr><tr style=\\\"height: 23px;\\\"><td style=\\\"height: 23px; width: 25px;\\\"><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 23px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: l\'&eacute;l&egrave;ve est d&eacute;l&eacute;gu&eacute; de la classe</span></span></td></tr><tr style=\\\"height: 19px;\\\"><td style=\\\"height: 19px; width: 25px;\\\">&nbsp; <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 19px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: m&eacute;mo valorisant l\'&eacute;l&egrave;ve</span></span></span></span></td></tr><tr style=\\\"height: 19px;\\\"><td style=\\\"height: 19px; width: 25px;\\\">&nbsp;<img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td style=\\\"height: 19px; width: 545px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;: anniversaire de l\'&eacute;l&egrave;ve</span></span></td></tr></tbody></table></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\"><span style=\\\"color: #ff0000;\\\">Nom de l\'&eacute;l&egrave;ve en rouge</span> : Il &eacute;tait absent&nbsp;&agrave; votre&nbsp;dernier cours</span></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">Nom de l\'&eacute;l&egrave;ve avec * : en sortie p&eacute;dagogique&nbsp;</span></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">Types de punitions</span></span><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\">&nbsp; possibles</span></span></strong></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><table border=\\\"0\\\"><tbody><tr><td><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td><span style=\\\"font-size: 12px;\\\">&nbsp;: devoir suppl&eacute;mentaire</span></td></tr><tr><td><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" /></td><td><span style=\\\"font-size: 12px;\\\">&nbsp;: retenue</span></td></tr></tbody></table></div></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><strong>D&eacute;compte des &eacute;v&egrave;nements pass&eacute;s</strong></span></div><span style=\\\"font-family: Arial; font-size: 12px;\\\">Dans chaque colonne, PRONOTE d&eacute;compte le nombre d\'&eacute;v&egrave;nements que vous avez affect&eacute; &agrave; chaque &eacute;l&egrave;ve depuis la date d&eacute;finie en haut &agrave; droite. Un double clic sur ce nombre affiche le d&eacute;tail des &eacute;v&egrave;nements de l\'&eacute;l&egrave;ve ainsi que, si vous en avez l\'autorisation, les &eacute;v&egrave;nements de m&ecirc;me nature dans les autres mati&egrave;res.</span></div>"},"width":695,"height":520,"type":4,"boutons":{"_T":18,"V":1024}}');
a("AbsenceVS.MFicheFeuilleAppelVSSansCours", '{"titre":"Comment renseigner la feuille \\\"Appel et suivi\\\" ?","html":{"_T":23,"V":"<div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">1. Choisissez votre classe ou groupe et d&eacute;finissez le cr&eacute;neau horaire en choisssant les horaires dans le bandeau de titre.</span></div><div style=\\\"text-align: left; text-indent: 0px; font-family: Arial; font-size: 13px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 8px;\\\">&nbsp;</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">2. Dans chaque colonne cochez les &eacute;l&egrave;ves concern&eacute;s par l\'&eacute;v&egrave;nement.</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Vous pouvez choisir d\'ajouter des rubriques facultatives dans la fen&ecirc;tre accessible depuis le bouton <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />.</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Dans chaque colonne, PRONOTE d&eacute;compte le nombre d\'&eacute;v&egrave;nements que vous avez affect&eacute; &agrave; &nbsp;chaque &eacute;l&egrave;ve depuis la date d&eacute;finie en haut &agrave; droite. Un double clic sur ce nombre affiche le d&eacute;tail des &eacute;v&egrave;nements de l\'&eacute;l&egrave;ve ainsi que, si vous en avez l\'autorisation, les &eacute;v&egrave;nements de m&ecirc;me nature dans les autres mati&egrave;res.</span></div>"},"width":440,"height":195,"type":4,"boutons":{"_T":18,"V":1024}}');
